import styles from "./Sidebar.module.css"; // ⬅️ без ../../
import Logout from "./Logout";

import Home from "../../Components/Sidebar/Home";
import Search from "../../Components/Sidebar/Search";
import Career from "../../Components/Sidebar/Career";
import Chats from "../../Components/Sidebar/Chats";
import Profile from "../../Components/Sidebar/Profile";
import Settings from "../../Components/Sidebar/Settings";
import NewPost from "../../Components/Sidebar/NewPost";

export default function Sidebar() {
  return (
    <div className={styles.sidebar}>
      <h1 className={styles.title}>Nodes</h1>
      <Home />
      <Search />
      <Career />
      <Chats />
      <Profile />
      <Settings />
      <NewPost />
      <Logout />
    </div>
  );
}
